import React from 'react'
import Frame from '../img/candidates/img.png'

const candidates = [
    {id: 1, name: 'Konang Tygazayn'},
    {id: 2, name: 'Kadek Ninda'},
    {id: 3, name: 'Billy Fahd Qodama'}
];

const Calon = props => {
    return (
        <div>
            <img src={Frame}></img>
            <div className='title'>
                {props.candidate.name}
            </div>
        </div>
    );
};

const List = () => {
    {candidates.map(candidate => {
        return <Calon candidate={candidate} key={candidate.id}/>;
    })}
};


export default function Candid() {
  return (
    <div>
        <List/>
    </div>
  )
}
